import React, { Component } from 'react';
import axios from 'axios'
import Map from './MapTest'
import FormContact from './FormContact/FormContact'

export default class Axios extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
            axios.get("http://localhost:3001/propiedades/" + this.props.value)
            .then(res => {
                const prop = res.data
                this.setState({ prop })
            })    
    }

    render() {
        const { prop } = this.state
        const zoomP = 13
        const heightP = 300

        const prefijo = "PROPIEDAD"
        const text = "Consultar por la Propiedad"

        return (
            <>
                <h1>{prop.id} </h1>
                <h2>{prop.tittle}</h2>
                <h3>{prop.price}</h3>
                <p>{prop.coordenadasP}</p>
                <Map
                    position={prop.coordenadasP}
                    zoom={zoomP}
                    popup={prop.tittle}
                    height={heightP}
                />
                <FormContact
                    asunto={prop.tittle}
                    pref={prefijo}
                    encabezado={text}
                />
            </>
        )
    }
}
